import './App.css';
import { BrowserRouter, Routes,Route } from 'react-router-dom';
import Nosotros from './components/nosotros';
import ShowProducts from './components/ShowForm';
import Formulario from './components/form';
import Inicio from './components/inicio';
import Contacto from './components/contacto';
import {Link} from 'react-router-dom';
import Container from '@mui/material/Container';

function App() {
  return(
    <Container maxWidth="md">

      <BrowserRouter>
      <nav>
        <ul>
          <li><Link to='/' className='btn btn-success  btn-lg mt-2 mb-2 text-white'>Home</Link></li>
          <li><Link to='/Inicio' className='btn btn-success  btn-lg mt-2 mb-2 text-white'>Inicio</Link></li>
          <li><Link to='/form' className='btn btn-success  btn-lg mt-2 mb-2 text-white'>Formulario</Link></li>
          <li><Link to='/Contacto' className='btn btn-success  btn-lg mt-2 mb-2 text-white'>Contacto</Link></li>
          <li><Link to='/Nosotros' className='btn btn-success  btn-lg mt-2 mb-2 text-white'>Nosotros</Link></li>
        </ul>
      </nav>
        <Routes>
          <Route path='/' element={<ShowProducts/>}/>
          <Route path='/form' element={<Formulario titleName={"Formulario de Ventas"}
        labelName={"Datos del Cliente"}
        buttonName={"Guardar"}/>}/>
          <Route path='/Inicio' element={<Inicio/>}/>
          <Route path='/Contacto' element={<Contacto/>}/>
          <Route path='/Nosotros' element={<Nosotros/>}/>
        </Routes>
      </BrowserRouter>

    </Container>
  
        
    )
    
  }

export default App;
